import { IonContent, IonHeader, IonPage, IonTitle, IonToolbar, IonButtons, IonMenuButton } from '@ionic/react';
import React from 'react';
import HomeComponent from '../components/HomeComponent';
import './HomePage.css';

const Home: React.FC = () => {
  return (
    <IonPage>
      <IonHeader>
        <IonToolbar mode="ios" color="light">
          <IonButtons slot="start">
            <IonMenuButton autoHide={false} color="primary" />
          </IonButtons>
          <IonTitle>
            <img alt="logo" height="40" float-left src="assets/image/absher-title.png" />
          </IonTitle>
          <img slot="end" alt="logo" height="40" float-left src="assets/image/logo.png" />
        </IonToolbar>
      </IonHeader>
      <IonContent>
        <IonToolbar mode="ios" class="bg-toolbar">
          <IonTitle class="top-padding" >
            <img alt="logo" height="40" float-left src="assets/image/toolbar-buttons.png"/>
          </IonTitle>
        </IonToolbar>
        <HomeComponent />
      </IonContent>
    </IonPage>
  );
};

export default Home;
